◽
Como você tem interpretado as situações de sua vida e como tem feito avaliações sobre tuas experiências  segundo a tua realidade? 
Este é o mês dedicado à prevenção ao suicídio e há uma necessidade urgente de falarmos sobre isso.
Já parou para pensar que as pessoas têm "seu próprio jeito de ser e de sofrer"?
O objetivo desse post é para chamar tua atenção, e assim, considere que ao buscar saídas para o sofrimento, encontre motivos que levem à esperança e à vida.
◽
Você pode ajudar alguém nesse processo.
Então,atenção às dicas:
◽Essa pessoa tem preferido a solidão?
(Isolamento, distanciamento afetivo);
◽Essa pessoa tem apresentado mudanças marcantes em seus comportamentos e hábitos?;
◽Essa pessoa tem falado/mencionado sobre a ideia de morte/morrer?;
◽Essa pessoa perdeu a vontade/interesse por atividades que gostava?;
◽Essa pessoa tem apresentado descuido com aparência?;
◽O desempenho no trabalho, nas tarefas do dia a dia e da casa tem piorado?;
◽ Alterações no sono e apetite tem se tornado frequentes?;
Pense a respeito, sinalize, converse, busque por ajuda.
Não sofra sozinho (a).
◽
